import React from 'react'
import Dates from "./Components/Title/Dates";
import styles from "./Components/Title/Title.module.css"

function Title() {
    return (
        <div>
            <h1>Weather Forcast</h1>
            <img src={styles.arrow}></img>
            <Dates />
        </div>
    )
}

export default Title
